import React from "react";
import "./slider.css";

const Slider = ({ onChange, disabled }) => {
  return (
    <div onChange={onChange}>
        <ul>
          <li>
            <input type="radio" name="speed" id="one" value={500} disabled={disabled} />
            <label for="one">Slow</label>
            <div className="check"></div>
          </li>

          <li>
            <input type="radio" name="speed" id="two" value={50} disabled={disabled} />
            <label for="two">Medium</label>
            <div className="check"></div>
          </li>
          
          <li>
            <input type="radio" name="speed" id="fast" value={5} disabled={disabled} />
            <label for="three">Fast</label>
            <div className="check"></div>
          </li>
        </ul>
      </div>
  );
};

export default Slider;
